DROP TABLE Asset CASCADE CONSTRAINTS ;

DROP TABLE Customer CASCADE CONSTRAINTS ;

DROP TABLE Holding CASCADE CONSTRAINTS ;

DROP TABLE Sector CASCADE CONSTRAINTS ;

DROP TABLE Status CASCADE CONSTRAINTS ;

DROP TABLE Trade CASCADE CONSTRAINTS ;

CREATE TABLE Asset
  (
    AssetNo   VARCHAR2 (20) NOT NULL ,
    AssetName VARCHAR2 (80) NOT NULL ,
    NetQty    NUMBER (18) ,
    SectorNo  NUMBER (5) NOT NULL
  ) ;
ALTER TABLE Asset ADD CONSTRAINT Asset_PK PRIMARY KEY ( AssetNo ) ;

CREATE TABLE Customer
  (
    CustNo       NUMBER (10) NOT NULL ,
    CustName     VARCHAR2 (50) ,
    CustAddress  VARCHAR2 (200) ,
    CustProvince VARCHAR2 (30) ,
    CustZip      NUMBER (8) ,
    CustPhone    VARCHAR2 (20)
  ) ;
ALTER TABLE Customer ADD CONSTRAINT Customer_PK PRIMARY KEY ( CustNo ) ;

CREATE TABLE Holding
  (
    HoldNo  NUMBER (20) NOT NULL ,
    CustNo  NUMBER (10) NOT NULL ,
    AssetNo VARCHAR2 (20) NOT NULL ,
    HoldQty NUMBER (18)
  ) ;
ALTER TABLE Holding ADD CONSTRAINT Holding_PK PRIMARY KEY ( HoldNo ) ;

CREATE TABLE Sector
  (
    SectorNo   NUMBER (5) NOT NULL ,
    SectorDesc VARCHAR2 (30) NOT NULL
  ) ;
ALTER TABLE Sector ADD CONSTRAINT Sector_PK PRIMARY KEY ( SectorNo ) ;

CREATE TABLE Status
  (
    StatusNo   NUMBER (3) NOT NULL ,
    StatusDesc VARCHAR2 (15) NOT NULL
  ) ;
ALTER TABLE Status ADD CONSTRAINT TradeType_PK PRIMARY KEY ( StatusNo ) ;

CREATE TABLE Trade
  (
    TradeNo  NUMBER (30) NOT NULL ,
    HoldNo   NUMBER (20) NOT NULL ,
    TrdQty   NUMBER (18) NOT NULL ,
    TrdPrice NUMBER (10,2) NOT NULL ,
    TrdDate  DATE NOT NULL ,
    TrdType  VARCHAR2 (15) ,
    StatusNo NUMBER (3) NOT NULL
  ) ;
ALTER TABLE Trade ADD CONSTRAINT Trade_PK PRIMARY KEY ( TradeNo ) ;

ALTER TABLE Asset ADD CONSTRAINT Asset_AssetGroup_FK FOREIGN KEY ( SectorNo ) REFERENCES Sector ( SectorNo ) ;

ALTER TABLE Holding ADD CONSTRAINT Holding_Asset_FK FOREIGN KEY ( AssetNo ) REFERENCES Asset ( AssetNo ) ;

ALTER TABLE Holding ADD CONSTRAINT Holding_Customer_FK FOREIGN KEY ( CustNo ) REFERENCES Customer ( CustNo ) ;

ALTER TABLE Trade ADD CONSTRAINT Trade_Holding_FK FOREIGN KEY ( HoldNo ) REFERENCES Holding ( HoldNo ) ;

ALTER TABLE Trade ADD CONSTRAINT Trade_Status_FK FOREIGN KEY ( StatusNo ) REFERENCES Status ( StatusNo ) ;

